import React from 'react';
import MovieList from './movies';
import Podcasts from './podcasts';

function NavBar() {
  return (
    <nav className="navBar">
      <ul>
        <li>
          <a href="./index">Home</a>
        </li>
        <li>
          <MovieList />
          <a href="./movies">Movies</a>
        </li>
        <li>
          <Podcasts />
          <a href="C:\Users\BYU Rental\Documents\IS413\JoelsFasterWebsite_olsenj8\frontend\src\podcasts.tsx">
            Podcasts
          </a>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
